{
  "type": "AdaptiveCard",
  "body": [
    {
      "size": "large",
      "text": "Get started using Jira in Teams",
      "weight": "bolder",
      "type": "TextBlock"
    },
    {
      "text": "Here are some of the things you can do:",
      "wrap": true,
      "type": "TextBlock"
    },
    {
      "text": "- **Link previews** show contextual information so you can see high-level details instantly\n- **Search** for Jira issues right within a Teams chat in the message extension\n- Add a Jira filter within a **tab** in a chat or team channel to easily reference issues within your projects\n- **Update issues** right in your conversation so you can focus on your work and avoid context switching between your web browser and Teams\n- **Add messages as comments** to update issues right when collaboration is happening\n- **Create new issues** from messages within a chat\n- Set up **channel notifications** so your team can get updates on key issues when it matters.",
      "wrap": true,
      "type": "TextBlock"
    },
    {
      "items": [
        {
          "text": "Unlock even more features like **personal notifications** and **share issues during a meeting** by adding Jira Cloud across Teams.",
          "wrap": true,
          "type": "TextBlock"
        },
        {
          "columns": [
            {
              "width": "auto",
              "items": [
                {
                  "actions": [
                    {
                      "data": {
                        "msteams": {
                          "type": "task/fetch"
                        },
                        "command": "installGuide",
                        "consversationType": "personal"
                      },
                      "title": "Personal Notifications",
                      "type": "Action.Submit"
                    },
                    {
                      "data": {
                        "msteams": {
                          "type": "task/fetch"
                        },
                        "command": "installGuide",
                        "consversationType": "meeting"
                      },
                      "title": "Meeting",
                      "type": "Action.Submit"
                    }
                  ],
                  "type": "ActionSet"
                }
              ],
              "type": "Column"
            }
          ],
          "type": "ColumnSet"
        }
      ],
      "separator": true,
      "type": "Container"
    }
  ],
  "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
  "version": "1.5",
  "msTeams": {
    "width": "full"
  }
}

